import React from 'react';
import { Layout, Row, Col } from 'antd';


import './Footer.scss';

export default function Footer() {
    const { Footer } = Layout;

    return (
        <Footer className='footer'>
            <Row>
                <Col md={4} />
            </Row>
        </Footer>
    )
}
